    /// <summary>Flags for OpenPopup*(), BeginPopupContext*(), IsPopupOpen() functions.<br/>- To be backward compatible with older API which took an 'int mouse_button = 1' argument, we need to treat.<br/>Small flags values as a mouse button index, so we encode the mouse button in the first few bits of the flags.<br/>It is therefore guaranteed to be legal to pass a mouse button index in ImGuiPopupFlags.<br/>- For the same reason, we exceptionally default the ImGuiPopupFlags argument of BeginPopupContextXXX functions to 1 instead of 0.<br/>IMPORTANT: because the default parameter is 1 (==ImGuiPopupFlags_MouseButtonRight), if you rely on the default parameter.<br/>And want to use another flag, you need to pass in the ImGuiPopupFlags_MouseButtonRight flag explicitly.<br/>- Multiple buttons currently cannot be combined/or-ed in those functions (we could allow it later).<br/>https://github.com/ocornut/imgui/blob/9cd9c2eff99877a3f10a7f9c2a3a5b9c15ea36c6/imgui.h#L1098.</summary>
